response.about:
Люди, родившиеся в понедельник, могут быть переменчивы по характеру, легко поддаются влиянию, могут быть капризны и упрямы, но они же очень отзывчивы, ласковы и чувствительны, как правило, у них хорошо развита интуиция.
Если Вы хотите завоевать расположение такого человека, независимо от того мужчина ли это или женщина, не давите на него, чаще дарите ему подарки.

Родившаяся в понедельник...
... нежная, мечтательная и чувствительная. Способна приспосабливаться к другому человеку, идти на уступки. Ей очень трудно жить одной. Она испытывает потребность поделиться теплом своего чувств и по-настоящему становится женщиной, только став матерью. Чувствительная к окружению, она стремится жить в гармонии с ним и идёт по жизни, следуя зову сердца.

Я не фотомодель - и вам никуда от этого не деться;
Я не красива - я черррртовски мила;
Я не кокетка - я так не умею;
Я не знаю себе цену - я ни разу ее не называла;
Я не принцесса - но для некоторых просто подарок;
У меня не "дурной" вкус в литературе - я просто читаю все!;
Я вам не хамлю - я просто использую длинные слова;
Я вас не перебиваю - просто у вас регламент;
Я не серьезная - мне скучно;
Я над вами не издеваюсь - я вас изучаю;
Я всех не ненавижу - всех я люблю, но некоторых меньше;

Во мне два "Я", два полюса планеты,
Два разных человека, два врага.
Когда один стремиться на балеты,
Другой стремится прямл на бега.

Я лишнего и в мыслях не позволю,
Когда живу от первого лица.
Но часто вырывается на волю,
Второе "Я" в обличье подлеца.

И Я боюсь, давлю в себе мерзавца,
О, участь беспокойная моя!
Боюсь ошибки: может оказаться,
Что Я давно не то, второе Я...
